def self.non_zch_data(patient_id)
  csv_path = "/var/www/appls/migration_imports/script/all_after_migration_scripts/zomba_fixes/TransInDateForArchivePatients_2016_06_24-the16.csv"
  FasterCSV.foreach(csv_path, :col_sep => ',', :headers => :first_row) do |row|
    patient_start_date = row["StepDate"]
    csv_patient_id = row["PatientIdCurrent"].to_i

    #check if patient_id is found in csv
    if patient_id == csv_patient_id
      #check for patient_visits >= csv encounter_datetime
      patient_visitsb = Encounter.find_by_sql("select * from #{Source_db}.encounter
                                             where patient_id = #{csv_patient_id}
                                             and voided = 0
                                             and encounter_datetime >= \"#{patient_start_date}\"
                                             group by DATE(encounter_datetime)")
      #loop through the visits
      (patient_visitsb || []).each do |visit|
        self.patient_visits_location_id_updated_to_zch(visit.patient_id, visit.encounter_datetime)
     end #end loop of visits
      #update location_id = zch
    end
  end
end

def self.patient_visits_location_id_updated_to_zch(patient_id, encounter_datetime)
  #check if visit has multiple locations
  pat_encs = Encounter.find_by_sql("select * from #{Source_db}.encounter e
                                    where e.patient_id = #{patient_id}
                                    and DATE(e.encounter_datetime) = DATE('#{encounter_datetime.to_date}')
                                    and e.location_id IN (select location_id from #{Source_db}.encounter
                                                          where patient_id = e.patient_id
                                                          and DATE(encounter_datetime) = DATE(e.encounter_datetime))
                                    and TIME(e.encounter_datetime) > '00:00:00'
                                    and e.voided = 0
                                    group by e.location_id").map(&:location_id)

 if (!pat_encs.blank?) && (pat_encs.length > 1)
   puts "working on patient #{patient_id}........."
  # raise pat_encs.length.to_yaml

   #update all location_id  = ZCH
   enc_ids = Encounter.find_by_sql("select encounter_id from #{Source_db}.encounter
                                    where patient_id = #{patient_id}
                                    and DATE(encounter_datetime) = DATE('#{encounter_datetime.to_date}')
                                    and voided = 0").map(&:encounter_id)
